Defendant in custody.
The defendant is sentenced to the Wisconsin State Prison System for a total of three and one-half (3.5) years.  That is eighteen (18) months initial confinement followed by two (2) years extended supervision, concurrent with the sentences imposed on 15 CF 92 and 15 CF 9.
The defendant has credit for 104 days.
Conditions of extended supervision:
1) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
2) AODA assessment and follow through;
3) Maintain fulltime employment, schooling or combination;
4) Pay court costs, including $60.00 buy money to Metro Drug Unit;
5) pay supervision fees in an amount to be determined by DOC;
6) maintain absolute sobriety;
7) Submit to random urine screens and pay for same;
8) Have no contact with any known drug dealers or users;
9) Defendant is to use only one doctor and one pharmacy.
In all files, the court finds the defendant eligible for the Substance Abuse Program, but not eligible for the Challenge Incarceration Program.
